const Resume = () => {
  return (
    <section className="bg-[#1a1a1a] mr-4 h-full overflowhidden ml-36 shadow-4xl rounded-md mt-4 mb-4">
      <img
        className="h-screen ml-[27em] py-2"
        src={require("../components/image/resume.jpg")}
        alt=""
      />
    </section>
  );
};

export default Resume;
